import React, {useState, useEffect} from "react";

function App() {
  let [data, setData] = useState();
  useEffect(() => {
    fetch("/api").then(response => {
      response.json();
    }).then(result => {
      console.log(result);
      setData(result);
    });
  }, [])
  return(
    <div>
      {data}
    </div>
  );
}

export default App;
